import './hero.css';
import { Link } from 'react-router-dom';

function Hero() {
    return (
        <>
        <div className='hero-section'>
            <h2>Welcome to The Self-Storage Owner’s Circle by Topsoil Property Co.</h2>
            <p>Titan Wealth Group is the management company for Self Storage Syndicated Equities, a Chicago, IL based investment firm that syndicates the acquisition and development of self storage facilities nationwide.</p>
            {/* <Link to="/"> */}
                <button className='lrn-more'>Learn More</button>
            {/* </Link> */}
        </div>
        <div className='about-section'>
            <h1>Who are we?</h1>
            <div className='row'>
                <img className='slide-img' src='https://images.unsplash.com/photo-1567450475250-21f5b6d98021?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1170&q=80' />
                <div class='text-center'>
                Titan Wealth Group is the management company for Self Storage Syndicated Equities, a Chicago, IL based investment firm that syndicates the acquisition and development of self storage facilities nationwide.Titan Wealth Group is the management company for Self Storage Syndicated Equities, a Chicago, IL based investment firm that syndicates the acquisition and development of self storage facilities nationwide.
                </div>
            </div>
        </div>
        <div className='slide-section about-section'>
            <h1>Benefits of The Self-Storage Owner’s Circle by Topsoil Property Co.</h1>
            <p></p>
        </div>
        </>
        )
}

export default Hero
